    [],nt"revision_timestamp": "2016-07-27T22:55:16.343570",nt"name": "crescent-lake-national-wildlife-refuge-and-north-platte-national-wildlife-refuge-annual-na-c7bee",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crescent
    Lake and North Platte National Wildlife Refuge outlines Refuge accomplishments during
    the 1987 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, public participation, compliance with
    environmental and cultural resource mandates, and research and investigations. Refuge
    administration is outlined; information about personnel, youth programs, volunteer
    programs, funding, safety, and technical assistance is given. Habitat management
    is also covered; subjects include wetlands, grasslands, grazing, haying, fire management,
    pest control, and wilderness areas. The wildlife section of the report discusses
    wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
    waterbirds, shorebirds, raptors, game mammals, fisheries resources, marking and
    bird banding, and disease control. The public uses of the Refuge described in this
    report include interpretive programs, hunting, fishing, trapping, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about new construction, rehabilitation, major maintenance,
    communication systems, and energy conservation. Cooperative programs and items of
    interest are provided at the end. Refuge brochures are attached.",nt"license_title":
